import React from "react";
import "../css/SliderCard.css";

function SliderCard({ image, description }) {
  return (
    <div className="sliderCard">
      <div className="sliderCard-header">
        <img src={image} alt="card" />
      </div>
      <div className="sliderCard-body">{description}</div>
      <div className="sliderCard-footer"></div>
    </div>
  );
}

export default SliderCard;
